  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:46.525628\",\n\t\"name\": \"marten-ecology-and-distribution-on-the-kenai-national-wildlife-refuge-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Marten (Martes americana) were studied
  on the Kenai National Wildlife Refuge from June 1986 through July 1988 to determine
  factors limiting their current distribution and to define possible reintroduction
  sites. Eleven individuals were live-trapped in two study areas, radio collared,
  and relocated 235 times. Two hundred eleven scats of known age were collected, and
  35-37 from each three-month season were analyzed for food habits. Seventy-four habitat
  transects in areas currently supporting marten and 40 transects near a potential
  release site which no longer appears to support marten were sampled for stand age,
  canopy cover and composition, snags, downed logs, and forest openings. Small mammal
  populations were sampled at four locations including the potential reintroduction
  site for species presence and relative abundance. Marten at Surprise Creek were
  snow-tracked for 12.2km to determine behavior and habitat associations. Soil Conservation
  Service 25-year average snow depth and density measurements were combined with snow
  depth data from one study area to ascertain snow conditions on portions of the Kenai
  Peninsula which currently support marten, areas where marten lived in the past,
  and on the lowlands, which has not appeared to support a marten population in recent
  times. The subspecies designation of Kenai marten was tested by comparing body measurements
  and pelage characteristics with those from the literature and by genetic comparisons
  with interior Alaska marten using electrophoresis.\",\n\t\"license_title\": \"License
